        else:
            res = floor(num)
    elif len(value) > 0:
        res = int(round(num))
    else:
        res = 0

    return res

import unittest

class TestClosestInteger(unittest.TestCase):

    def test_integer(self):
        self.assertEqual(closest_integer("10"), 10)

    def test_positive_number_with_decimal_point(self):
        self.assertEqual(closest_integer("15.3"), 15)

    def test_negative_number_with_decimal_point_farther_from_zero(self):
        self.assertEqual(closest_integer("-14.5"), -15)

    def test_negative_number_with_decimal_point_closer_to_zero(self):
        self.assertEqual(closest_integer("-14.6"), -14)

    def test_empty_string(self):
        self.assertEqual(closest_integer(""), 0)

if __name__ == '__main__':
    unittest.main(argv=['first-arg-is-ignored'])()

